    [],nt"revision_timestamp": "2015-05-07T00:49:57.180735",nt"name": "nanotube-electrodes-for-dust-mitigation-project-ffb31",nt"isopen":
    true,nt"url": null,nt"notes": "Dust mitigation is critical to the survivability
    of vehicle and infrastructure components and systems and to the safety of astronauts
    during EVAs and planetary surface operations. By coupling Eikos Invisicon&lt;SUP&gt;REG&lt;/SUP&gt;
    nanocomposite conductors with existing dust mitigation Dust Shield technology developed
    at NASA-KSC, the Phase I program demonstrated an enabling approach to producing
    electrodynamic dust mitigation devices on a wide variety of surfaces not possible
    with traditional metal based electrode materials. Eikos reproduced proven NASA spiral
    electrodes using Invisicon&lt;SUP&gt;REG&lt;/SUP&gt; patterned onto transparent
    plastics, Tyvek&lt;SUP&gt;REG&lt;/SUP&gt; fabric, and silicone rubber sheets; employing
    inkjet and spray deposition methods, two CNT ink formulations, and four dielectric
    binders to create working devices. These Invisicon&lt;SUP&gt;REG&lt;/SUP&gt;-based
    devices are far more flexible then traditional devices and exhibit superior durability
    to abrasion, elongation, and thermal cycling.   A dust mitigation system utilizing
    this technology has broad value to many NASA mission directorates and terrestrial
    commercial applications. The Phase II project will build on these successes and
    integrate the electrode into larger surfaces, and more complex components. Further,
    extensive dust mitigation, and both environmental and mechanical testing, will be
    conducted to position this electrode technology for insertion into windows, fabrics,
    and elastomeric components in space and terrestrial applications.",nt"license_title":
